import React from 'react';
import './UserDashboard.css'; // Import CSS for styling

const UserDashboard = () => {
    return (
        <div className="user-dashboard">
            <h1>Welcome to Your Dashboard</h1>
            <div className="dashboard-content">
                <section className="dashboard-section">
                    <h2>Your Events</h2>
                    <p>View and manage your events here.</p>
                    {/* Add code to display user's events, e.g., a list or table */}
                </section>
              
                <section className="dashboard-section">
                    <h2>Feedback</h2>
                    <p>Provide feedback or view your past feedback.</p>
                    {/* Add code to display or submit feedback */}
                </section>
            </div>
        </div>
    );
};

export default UserDashboard;
